import React from 'react';

import './App.css';

class App extends React.Component {
  render() {
    return (
    <div className="App">
      <header className="App-header">
        <img src='CostaRica.jpg' className="App-logo" alt="CostaRica" />
          Spektorkovs!
      </header>
    </div>
  );}
}

export default App;
